                <h1>ContentCntr</h1>
                <div className='rowFlex'>
                    <img src='https://pixabay.com/photos/christmas-background-flat-lay-1911637/' alt=''  className='image'/>
                </div>
            </div>
        </>
    )
}

export default ContentCntr;
